  false,\n\t\"url\": null,\n\t\"notes\": \"The Centre National Pour l'Exploitation
  des Oceans (CNEXO)n     ferromanganese nodule analysis files consist of geochemical
  data from publishedn     reports pertaining to oceanic ferromanganese deposits,
  including Russian, since 1891.n     Data were compiled under the direction of Professor
  Jean-Marie Monget of Ecoles de Mines, Parisn     through 1976 and contain data for
  nearly 200 marine core, dredge, and grab samples. Datan     include method of analysis,
  oxide/item/element concentrations, location, water depth,n     sample lithology,
  and bibliographic references. The CNEXO data are also available asn     part of
  the NOAA and MMS marine minerals database and are offered on the NOAA and MMSn     Marine
  Minerals CD-ROM data set released in October of 1992. The CNEXO datan     are also
  available for direct download from NCEI's web server.\",\n\t\"license_title\": null,\n\t\"extras\":
